import React, { Component } from 'react';

class UserList extends Component {    
    componentDidMount(){
        axios.get('/user?ID=12345')
        .then(function (response) {
            console.log(response);
        })
        .catch(function (error) {
            console.log(error);
        });
    }
    render() {        
        return (
            <h1>Users List</h1>
        );
    }
}

export default UserList;
